export async function GetPrediction (model, sample)
{
	if (model == null)
		return -1;
	if (sample == null)
		return -2;
	var get = new XMLHttpRequest ();
	get.open ("GET", "http://localhost:8000/GetPrediction.php", true);
	let promise = new Promise ((resolve) => {
      resolve (get.send());
  });
	let obj = await promise;
	return get.responseText;
}
